import React from 'react'
import { useState } from 'react'

const Steps1 = () => {

  const [Steps, setSteps] =useState([
    {
      step:'Step 1',
      info : 'Your Info'
    },
    {
      step:'Step 2',
      info : 'Your Info'
    },
    {
      step:'Step 3',
      info : 'Your Info'
    },
    {
      step:'Step 4',
      info : 'Your Info'
    }
  ])
  return (

    <>
    
        <div className="step-box" >
          <div className="row">
            <div className="index">
                <p>1</p>
                </div>
            <div className="steps">
              <p>Step 1 </p>
              <p>Your Info</p>
            </div>
          </div>
        </div>
    
   
    
    </>
    
  )
}

export default Steps1
